                            BirthDate = new DateTime(1996, 2, 11, 0, 0, 0, 0, DateTimeKind.Unspecified),
                            DateCreated = new DateTime(2024, 8, 31, 13, 39, 48, 448, DateTimeKind.Local).AddTicks(8190),
